Yugoslavia was invaded by the Axis powers on 6 April 1941. In 1943, a Democratic Federal Yugoslavia was proclaimed by the Partisan resistance. The monarchy was abolished in November 1945.
Yugoslavia was renamed the <b>Federal People''s Republic of Yugoslavia</b> in 1946, when a communist government was established. It acquired the territories of Istria, Rijeka, and Zadar from Italy. In 1963, the country was renamed again, as the <b>Socialist Federal Republic of Yugoslavia</b>.
In 1992 Yugoslavia broke up along its republics'' borders into five countries. The republics of Montenegro and Serbia formed a reduced federative state, known officially until 2003 as the </b>Federal Republic of Yugoslavia</b>.');
On 4 February 2003, the federal assembly of Yugoslavia created a loose state union or confederacy: <b>The State Union of Serbia and Montenegro</b>, although Yugoslavia was still commonly used.
On 21 May 2006, an independence referendum was held in Montenegro, in which 55.5% of voters voted in favor of independence. Montenegro''s declaration of independence was held on 3 June 2006, and Serbia''s formal declaration of independence on 5 June.<br>
The Serbian Republic continued using the Yugoslav Dinar, renaming it in 2003 as the Serbian Dinar. <br>
Montenegro adopted the Deutsch Mark in 1999, in parallel with the Yugoslav dinar until 2000, and continued to use it until the mark fell into disuse to be replaced by the Euro in 2002.');
