INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (72, 'Pta', 'Peseta', 'Spanish peseta', '1869', '2002-02-28', 74, 166.386, 'The name of the currency comes from "pesseta", a Catalan diminutive of the Catalan word peça (meaning piece or fraction) or the Spanish Peso. The word peseta has been known as early as 1737 to colloquially refer to the coin worth 2 reales provincial or ​1⁄5 of a peso.
