INSERT INTO public.ser_series (ser_id, ser_cur_id, ser_name, ser_start, ser_end, ser_iss_id, ser_law_date, ser_description, ser_is_overstamped) VALUES (49, 72, '2nd Republic, 1st issue (Provisional)', 1931, 1931, 1, NULL, 'All the legal banknotes in circulation at the time the 2nd Republic was established on April 14, 1931, were overstamped (decree from July 23, 1931). That included most of the banknotes issued after 1906. Banknotes without the Republic stamp would not be accepted anymore after September 20.
INSERT INTO public.ser_series (ser_id, ser_cur_id, ser_name, ser_start, ser_end, ser_iss_id, ser_law_date, ser_description, ser_is_overstamped) VALUES (10, 72, 'Spanish State, last issue', 1973, 1974, 1, NULL, 'The issue contains all the 3 available denominations. Last issue under Dictator Franco''s rule.', 0);
INSERT INTO public.ser_series (ser_id, ser_cur_id, ser_name, ser_start, ser_end, ser_iss_id, ser_law_date, ser_description, ser_is_overstamped) VALUES (6, 74, 'Second Series (Europa)', 2013, NULL, 2, NULL, 'Same themes as the first series, but redesigned. The 100 € and 200 € notes are slightly smaller and have the same height as the 50€ banknote. The 500 € banknote is not issued.<br>The printer code is not used anymore. The printing facility is indicated by the first character of the serial number, see <a href="/data/euroarea/euro/serial-number-codes.html" target="_blank" style="text-decoration: none"><b>Printer Codes</b></a><br>See <a href="/data/euroarea/euro/the_first_euros_2015en.pdf" target="_blank" style="text-decoration: none"><b>"The first Euros"</b></a><br> ', 0);
INSERT INTO public.ser_series (ser_id, ser_cur_id, ser_name, ser_start, ser_end, ser_iss_id, ser_law_date, ser_description, ser_is_overstamped) VALUES (3, 72, 'Juan Carlos I, first issue', 1978, 1978, 1, NULL, 'This series includes only the new 5000 pesetas denomination, already designed and planned before the death of dictator Franco.', 0);
INSERT INTO public.ser_series (ser_id, ser_cur_id, ser_name, ser_start, ser_end, ser_iss_id, ser_law_date, ser_description, ser_is_overstamped) VALUES (2, 72, 'Juan Carlos I, second issue', 1982, 1987, 1, NULL, 'First complete series of banknotes under the reign of Juan Carlos I. If introduces the pattern 1 - 2 - 5 (starting with 200 pesetas)', 0);
INSERT INTO public.ser_series (ser_id, ser_cur_id, ser_name, ser_start, ser_end, ser_iss_id, ser_law_date, ser_description, ser_is_overstamped) VALUES (1, 72, 'Juan Carlos I, third issue', 1993, 1995, 1, NULL, 'Last series of the Spanish peseta banknotes. It does not include 200 or 500 pesetas, which were already issued as coins.
INSERT INTO public.ser_series (ser_id, ser_cur_id, ser_name, ser_start, ser_end, ser_iss_id, ser_law_date, ser_description, ser_is_overstamped) VALUES (13, 72, 'Spanish State, 6th issue', 1951, 1951, 1, NULL, NULL, 0);
