INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (87, 2, 5, 'GP', 'GLP', 'Guadeloupe', 'Overseas department of Guadelope', 1946, NULL, 74, NULL, 'In 1946, the colony of Guadeloupe became an overseas department of France. Through a referendum in 2003, Saint-Martin and Saint Barthélemy voted to separate from the administrative jurisdiction of Guadeloupe, this being fully enacted by 2007.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (254, 2, 5, 'BL', 'BLM', 'Saint Barthélemy', 'Territorial Collectivity of Saint-Barthélemy', 2007, NULL, 74, NULL, 'Through a referendum in 2003, Saint Barthélemy voted to separate from the administrative jurisdiction of Guadeloupe, this being fully enacted by 2007.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (260, 2, 5, 'MF', 'MAF', 'Saint Martin ', 'Collectivity of Saint Martin', 2007, NULL, 74, NULL, 'Through a referendum in 2003, Saint-Martin  voted to separate from the administrative jurisdiction of Guadeloupe, this being fully enacted by 2007.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (360, 6, 3, NULL, NULL, 'Serbia', 'Kingdom of Serbia', 1867, 1918, NULL, '284', 'The Kingdom of Serbia was created when the ruler of the Principality of Serbia, Milan I was proclaimed king in 1882.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (361, 6, 5, NULL, NULL, 'Croatia', 'Independent State of Croatia', 1941, 1945, 81, '284', 'The Independent State of Croatia was a World War II-era puppet state of Nazi Germany and Fascist Italy');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (62, 5, 3, 'TL', 'TLS', 'Timor-Leste', 'Democratic Republic of Timor-Leste', 2002, NULL, NULL, NULL, 'East Timor was colonised by Portugal in the 16th century and was known as Portuguese Timor until 28 November 1975, when the Revolutionary Front for an Independent East Timor (Fretilin) declared the territory''s independence. Nine days later, it was invaded and occupied by the Indonesian military; it was declared Indonesia''s 27th province the following year. 
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (297, 5, 5, 'TP', 'TMP', 'Portuguese Timor', 'East Timor', 1702, 1975, 172, '265', 'From 1702 to 1975, East Timor was an overseas territory of Portugal named "Portuguese Timor". In 1974, Portugal initiated a gradual decolonization process of its remaining overseas territories, including Portuguese Timor. During the process, a civil conflict between the different Timorese parties erupted. In 1975, Indonesia invaded East Timor and in 1976, it formally annexed the territory.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (265, 5, 5, 'TP', NULL, 'East Timor', 'East Timor', 1976, 2002, 101, '62', 'In 1975, Indonesia invaded East Timor and in 1976, it formally annexed the territory, declaring it as its 27th province and renaming it Timor Timur. In 1999, following the United Nations-sponsored act of self-determination, Indonesia relinquished control of the territory. As "Timor-Leste", it became a sovereign state on 20 May 2002 and joined the United Nations.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (124, 5, 5, 'MO', 'MAC', 'Macao', 'Macao Special Administrative Region of the People''s Republic of China', 1999, NULL, 44, NULL, 'Macao (or Macau) was a former colony of the Portuguese Empire, after Ming China leased the territory as a trading post in 1557. Portugal paid an annual rent and administered the territory under Chinese sovereignty until 1887 when it gained perpetual colonial rights in the Sino-Portuguese Treaty of Peking. The colony remained under Portuguese rule until 1999, when it was transferred to China.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (362, 5, 5, NULL, NULL, 'Portuguese Macao', 'Overseas Province of Macao', 1557, 1999, 172, '124', 'In 1557, Portugal had established a permanent settlement in Macao, paying an annual ground rent of 500 taels. By 1583, the enclave had a municipal government with a Senate Council.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (97, 5, 5, 'HK', 'HKG', 'Hong Kong', 'Hong Kong Special Administrative Region of the People''s Republic of China', 1997, NULL, 44, NULL, 'Hong Kong became a colony of the British Empire after the Qing Empire ceded Hong Kong Island at the end of the First Opium War in 1842. The colony expanded to the Kowloon Peninsula in 1860 after the Second Opium War and was further extended when Britain obtained a 99-year lease of the New Territories in 1898.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (363, 5, 5, NULL, NULL, 'British Hong Kong', 'British Dependent Territory of Hong Kong', 1842, 1997, 224, '97', 'British Hong Kong was a colony and dependent territory of the United Kingdom from 1841 to 1997, apart from a brief period under Japanese occupation from 1941 to 1945. The colonial period began with the occupation of Hong Kong Island in 1841 during the First Opium War. The island was ceded by Qing Empire in the aftermath of the war in 1842 and established as a Crown colony in 1843. The colony expanded to the Kowloon Peninsula in 1860 after the Second Opium War and was further extended when the UK obtained a 99-year lease of the New Territories in 1898.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (288, 4, 3, 'CD', 'COD', 'Congo, Democratic Republic', 'Democratic Republic of the Congo', 1997, NULL, NULL, NULL, 'The Democratic Republic of the Congo (DRC), also known as DR Congo, Congo-Kinshasa, the DROC, the Congo and historically Zaire, is a country in Central Africa.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (163, 7, 3, 'PW', 'PLW', 'Palau', 'Republic of Palau', 1994, NULL, NULL, NULL, 'Palau (historically Belau, Palaos or Pelew) is an island country located in the western Pacific Ocean. The country contains approximately 340 islands, and together with parts of the Federated States of Micronesia, forms the western chain of the Caroline Islands.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (244, 4, 2, NULL, NULL, 'West African Union', 'West African Economic and Monetary Union', 1994, NULL, NULL, NULL, 'The West African Economic and Monetary Union (also known as UEMOA from its name in French, Union économique et monétaire ouest-africaine) is an organisation of eight, mainly francophone West African states within the ECOWAS. It was established to promote economic integration among countries that share the CFA franc as a common currency. UEMOA was created by a Treaty signed at Dakar, Senegal, on 10 January 1994, by the governments of Benin, Burkina Faso, Côte d''Ivoire, Mali, Niger, Senegal, and Togo. On 2 May 1997, Guinea-Bissau, a former Portuguese colony, became the organisation''s eighth (and only non-francophone) member state.');
